import React from 'react'
import { Link } from 'react-router-dom';

const Landpage = () => {
    return (
        <section className="landing">
            <h1> Landing </h1>
            <Link to='/register'>Register</Link>
            <Link to='/login'>Login</Link>
        </section>
    )
}

export default Landpage;
